import React, { useState, useEffect } from 'react';
import { useDataIngestion } from '../services/DataIngestionContext';
import StatCard from '../components/StatCard';
import BarChart from '../components/BarChart';
import './Dashboard.css';

const Dashboard = () => {
  const { 
    getStatistics, 
    getTiradoresStatistics, 
    getSesionesStatistics, 
    getAnalisisCompleto 
  } = useDataIngestion();
  
  const [statistics, setStatistics] = useState(null);
  const [tiradoresStats, setTiradoresStats] = useState(null);
  const [sesionesStats, setSesionesStats] = useState(null);
  const [analisisCompleto, setAnalisisCompleto] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadAllStatistics();
  }, []);

  const loadAllStatistics = async () => {
    try {
      setLoading(true);
      const [stats, tiradores, sesiones, analisis] = await Promise.all([
        getStatistics(),
        getTiradoresStatistics(),
        getSesionesStatistics(),
        getAnalisisCompleto({ limit: 10 })
      ]);
      
      setStatistics(stats);
      setTiradoresStats(tiradores);
      setSesionesStats(sesiones);
      setAnalisisCompleto(analisis);
    } catch (err) {
      setError('Error cargando estad√≠sticas');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container">
        <div className="alert alert-error">
          {error}
        </div>
      </div>
    );
  }

  return (
    <div className="dashboard">
      <div className="container">
        <h2>Dashboard - Data Ingestion System</h2>
        <p className="dashboard-description">
          Sistema de ingesta y procesamiento de datos para evidencia big data.
        </p>
      </div>

      {/* Estad√≠sticas Generales */}
      <div className="grid grid-3">
        <div className="card">
          <div className="card-title">Total de Registros</div>
          <div className="card-content">
            <div className="stat-number">
              {statistics?.total_records || 0}
            </div>
            <div className="stat-label">Registros procesados</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">Total de Tiradores</div>
          <div className="card-content">
            <div className="stat-number">
              {tiradoresStats?.total_tiradores || 0}
            </div>
            <div className="stat-label">Tiradores registrados</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">Total de Sesiones</div>
          <div className="card-content">
            <div className="stat-number">
              {sesionesStats?.total_sesiones || 0}
            </div>
            <div className="stat-label">Sesiones de tiro</div>
          </div>
        </div>
      </div>

      {/* Estad√≠sticas de Rendimiento */}
      <div className="grid grid-4">
        <div className="card">
          <div className="card-title">Precisi√≥n Promedio</div>
          <div className="card-content">
            <div className="stat-number">
              {sesionesStats?.precision_promedio ? 
                `${sesionesStats.precision_promedio.toFixed(1)}%` : 'N/A'}
            </div>
            <div className="stat-label">Tasa de aciertos</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">Distancia Promedio</div>
          <div className="card-content">
            <div className="stat-number">
              {sesionesStats?.distancia_promedio ? 
                `${sesionesStats.distancia_promedio.toFixed(1)}m` : 'N/A'}
            </div>
            <div className="stat-label">Metros de tiro</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">Tiempo Promedio</div>
          <div className="card-content">
            <div className="stat-number">
              {sesionesStats?.tiempo_promedio ? 
                `${sesionesStats.tiempo_promedio.toFixed(1)}s` : 'N/A'}
            </div>
            <div className="stat-label">Segundos por tiro</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">G√©neros</div>
          <div className="card-content">
            <div className="stat-number">
              {tiradoresStats?.generos_unicos || 0}
            </div>
            <div className="stat-label">Diversidad</div>
          </div>
        </div>
      </div>

      {/* Estad√≠sticas de Tiradores */}
      <div className="grid grid-3">
        <div className="card">
          <div className="card-title">Edad Promedio</div>
          <div className="card-content">
            <div className="stat-number">
              {tiradoresStats?.edad_promedio ? 
                `${tiradoresStats.edad_promedio.toFixed(1)} a√±os` : 'N/A'}
            </div>
            <div className="stat-label">Promedio de edad</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">Experiencia Promedio</div>
          <div className="card-content">
            <div className="stat-number">
              {tiradoresStats?.experiencia_promedio ? 
                `${tiradoresStats.experiencia_promedio.toFixed(1)} a√±os` : 'N/A'}
            </div>
            <div className="stat-label">A√±os de pr√°ctica</div>
          </div>
        </div>

        <div className="card">
          <div className="card-title">Altura Promedio</div>
          <div className="card-content">
            <div className="stat-number">
              {tiradoresStats?.altura_promedio ? 
                `${tiradoresStats.altura_promedio.toFixed(2)}m` : 'N/A'}
            </div>
            <div className="stat-label">Metros de estatura</div>
          </div>
        </div>
      </div>

      {/* An√°lisis de Rendimiento */}
      {analisisCompleto.length > 0 && (
        <div className="container">
          <h3>An√°lisis de Rendimiento</h3>
          <div className="performance-analysis">
            <div className="analysis-grid">
              <div className="analysis-card">
                <h4>Mejores Tiradores por Precisi√≥n</h4>
                <div className="performance-list">
                  {analisisCompleto
                    .sort((a, b) => (b.precision_porcentaje || 0) - (a.precision_porcentaje || 0))
                    .slice(0, 5)
                    .map((tirador, index) => (
                      <div key={index} className="performance-item">
                        <div className="performance-name">{tirador.nombre}</div>
                        <div className="performance-value">
                          {tirador.precision_porcentaje ? 
                            `${tirador.precision_porcentaje.toFixed(1)}%` : 'N/A'}
                        </div>
                      </div>
                    ))}
                </div>
              </div>

              <div className="analysis-card">
                <h4>Distribuci√≥n por G√©nero</h4>
                <div className="gender-distribution">
                  {analisisCompleto.reduce((acc, item) => {
                    const genero = item.genero || 'No especificado';
                    acc[genero] = (acc[genero] || 0) + 1;
                    return acc;
                  }, {})}
                  {Object.entries(
                    analisisCompleto.reduce((acc, item) => {
                      const genero = item.genero || 'No especificado';
                      acc[genero] = (acc[genero] || 0) + 1;
                      return acc;
                    }, {})
                  ).map(([genero, count]) => (
                    <div key={genero} className="gender-item">
                      <span className="gender-label">{genero}</span>
                      <span className="gender-count">{count}</span>
                    </div>
                  ))}
                </div>
              </div>

              <div className="analysis-card">
                <h4>Ambientes de Tiro</h4>
                <div className="environment-stats">
                  {Object.entries(
                    analisisCompleto.reduce((acc, item) => {
                      const ambiente = item.ambiente || 'No especificado';
                      acc[ambiente] = (acc[ambiente] || 0) + 1;
                      return acc;
                    }, {})
                  ).map(([ambiente, count]) => (
                    <div key={ambiente} className="environment-item">
                      <span className="environment-label">{ambiente}</span>
                      <span className="environment-count">{count}</span>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      )}

      <div className="container">
        <h3>Acciones R√°pidas</h3>
        <div className="quick-actions">
          <a href="/ingest" className="btn btn-primary">
            Ingresar Nuevos Datos
          </a>
          <a href="/view" className="btn btn-secondary">
            Ver Datos Existentes
          </a>
        </div>
      </div>

      <div className="container">
        <h3>Estado del Sistema</h3>
        <div className="system-status">
          <div className="status-item">
            <span className="status-label">API Backend:</span>
            <span className="status-value status-healthy">Conectado</span>
          </div>
          <div className="status-item">
            <span className="status-label">Base de Datos:</span>
            <span className="status-value status-healthy">Activa</span>
          </div>
          <div className="status-item">
            <span className="status-label">Procesamiento:</span>
            <span className="status-value status-healthy">Operativo</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
